The Jackson 5 Christmas Album was the only holiday album released by Motown family 
quintet The Jackson 5. Released in October 1970, the album showcased the brothers' 
harmonies and vocals. Lead singer Michael Jackson is prominently featured on the 
album tracks. Included on the Christmas Album is the Jackson 5's hit single version 
of &quot;Santa Claus Is Coming to Town&quot;. Rendered with a pop-soul feel, the Jackson 5's 
versions of &quot;I Saw Mommy Kissing Santa Claus&quot; and &quot;Santa Claus Is Coming to Town&quot; 
remain frequent radio requests during the holiday season.

The album spent all four weeks at the number one position on Billboard magazine's 
special Christmas Albums chart that the magazine published in December 1970, making 
it the best-selling holiday album of that year. It has sold over 3.5 million copies 
worldwide




